values:
Its been forever since ive written on here, alots been going on lately!&nbsp;Lets see.. this weekend is a long one, yeah baby. im going to athens tonight with my parents to go see the mccormicks..even though i&nbsp;probaby wont be able to see matt i want to be there for his sister kelsey. also my dad made this like gigantic cross that we are going to put on the side of the rode where the wreck happened, for jacob.&nbsp;these past few weeks have been so hard on everyone, jacob and aj both had parts of my heart. jacob and matt were the first people i met here, ha and they were forced to pretty much babysit me freshmen year..sat with them at lunch when i had no friends, talked sense into me at times, stuck up for me,..the best big brothers ever! and whenever i was with aj we always ended up doing something crazy. i wish i could have just one more time.&nbsp; 

But on a brighter note..! 
im coming back saturday and hopefully be able to do something! just got in trouble again..big surprise there. whitfield bound. and monday should be pretty sweet, CHEETAH GIRLS AND HANNAH MONTANNA concert!!&nbsp;ha so hit me up.
